import React, { useState } from "react";
import "./App.css";

function App() {
  return (
    <>
      <Form />
      <Title />
      <Box />
    </>
  );
}
function Form() {
  const [todoList, setTodoList] = useState([
    { title: "리액트를 배워봅시다!!!" },
  ]);
  return (
    <div className="inputForm">
      <input type="text"></input>
      <button>추가하기</button>
    </div>
  );
}
function Title() {
  return (
    <div className="title">
      <h1>Todo List</h1>
    </div>
  );
}

function Box({ todoList }) {
  return (
    <div className="box">
      <p>{todoList.title}</p>
    </div>
  );
}
export default App;
